app.use(express.static('public'));
app.set('view engine', 'ejs');
app.get('/', (req, res)=> {
    const initialContent = serverRender();
    res.render('index', {initialContent});
});
app.listen(config.port, ()=> {
    console.info(`Running on port ${config.port}...`);
});

